import React, { useState } from 'react';
import {
    Carousel,
    CarouselItem,
    CarouselControl,
    CarouselIndicators,
    CarouselCaption
} from 'reactstrap';

import slide1 from '../assets/carousel/cheese-storage.jpg';

// Array of carousel items (images and captions)
const items = [
    {
        src: slide1,
        altText: 'Slide 1',
        caption: 'Delicious Cheese 1'
    },
    {
        src: 'https://via.placeholder.com/800x400?text=Cheese+2',
        altText: 'Slide 2',
        caption: 'Delicious Cheese 2'
    },
    {
        src: 'https://via.placeholder.com/800x400?text=Cheese+3',
        altText: 'Slide 3',
        caption: 'Delicious Cheese 3'
    }
];

function HomePageCarousel() {
    return (
        console.log("Carousel"),
        <div>
            <h2>Testing Carousel</h2>
            <div style={{ width: "100%", height: "400px", background: "gray" }}>
                This is a placeholder for the carousel.
            </div>
        </div>
    );
}
export default HomePageCarousel;
